import React from 'react';
import s from './Operators.module.css'
import Item from '../Item/Item';
const Operators = (props) => {
    debugger;
    let operators = props.operators;
    return (
      <div className={s.item__wrapper}>
        <h3 className={s.title}>Выбирите вашего оператора</h3>
        <Item
          content={operators[0].name}
          source={operators[0].source}
          link={() => "/checklist/" + operators[0].id}
        />
        <Item
          content={operators[1].name}
          source={operators[1].source}
          link={() => "/checklist/" + operators[1].id}
        />
        <Item
          content={operators[2].name}
          source={operators[2].source}
          link={() => "/checklist/" + operators[2].id}
        />
      </div>
    );
        }
export default Operators;
